<!DOCTYPE html>
<html lang="en" class="h-100">

<head>
  <meta charset="UTF-8">
  <title>Caption Creator</title>
  <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/twitter-bootstrap/4.1.3/css/bootstrap.min.css">
  <!-- <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/5.11.2/css/all.min.css"> -->
  <style>
    /* * {
      border: .5px solid pink;
    } */
    #app {
      padding-top: 1em;
      /* display: none; */
    }
    .left-editor{
      font-size: 1.1rem;
    }
    /* .left-editor {
      overflow-y: auto;
      height: auto;
    } */
  </style>
</head>

<body class="h-100">

  <div id="app" class=" container h-100">
    <header>
      <h1>Caption Creator</h1>
    </header>
    <main>
      <aws-input :awsinput="awsinput" v-model="awsinput"></aws-input>
      <div class="row">

        <left-editor class="col" :words="words" :awsjson="awsJSON"></left-editor>
        <!-- <div class="col-4">test</div> -->
      </div>
    </main>
    <footer>
    </footer>
  </div>

  <template id="aws-input">
    <div class="aws-input">
      <div class="form-group">
        <label for="exampleFormControlTextarea1">Example textarea</label>
        <textarea class="form-control" id="exampleFormControlTextarea1" rows="3" :value="awsinput" v-on:input="$emit('input', $event.target.value)"></textarea>
      </div>
    </div>
  </template>

  <template id="left-editor">
    <div class="left-editor">
      <!-- <a v-for="(word, index) in awsjson.results.items" class="btn btn-outline-secondary" href="#" role="button">{{word.alternatives[0].content}}</a> -->
      <span v-for="(item, index) in awsjson.results.items" class="" :style="'background-color: rgb(' + (item.alternatives[0].confidence * 255) + ',0,0);'" :title="item.alternatives[0].confidence">
        <span v-if="index != '0' && item.type == 'pronunciation'">&nbsp;</span>
        {{item.alternatives[0].content}}</span>
      <!-- <input v-for="(item, index) in awsjson.results.items" type="text" v-model="item.alternatives[0].content"> -->
      <!-- <span editable="true" v-for="item in items">{{item}}</span> -->
    </div>
  </template>

  <template id="modal-editor">
    <div class="modal fade" id="exampleModalCenter" tabindex="-1" role="dialog"
      aria-labelledby="exampleModalCenterTitle" aria-hidden="true">
      <div class="modal-dialog modal-dialog-centered" role="document">
        <div class="modal-content">
          <div class="modal-header">
            <h5 class="modal-title" id="exampleModalCenterTitle">Update Caption</h5>
            <button type="button" class="close" data-dismiss="modal" aria-label="Close">
              <span aria-hidden="true">&times;</span>
            </button>
          </div>
          <div class="modal-body">
            <div class="form-group">
              <label for="exampleInputEmail1" class="sr-only">Update Word</label>
              <input type="email" class="form-control" id="exampleInputEmail1" aria-describedby="emailHelp"
                v-model="wordtoupdate">
              <!-- <small id="emailHelp" class="form-text text-muted">We'll never share your email with anyone else.</small> -->
            </div>
          </div>
          <div class="modal-footer">
            <button type="button" class="btn btn-secondary" data-dismiss="modal">Close</button>
            <!-- <button type="button" class="btn btn-primary">Save changes</button> -->
          </div>
        </div>
      </div>
    </div>
  </template>
